INSERT INTO `ce_etimologia` (`id_eti`, `text_1_ini`, `text_1_intro`, `id_pais`) VALUES
	(1, '<div><h2>¡Hola!</h2><p class="text-justify">La encuesta que estás respondiendo es de gran utilidad para medir el compromiso que tienes con tus estudios y el colegio, y así poder saber qué estudiantes o cursos requieren un apoyo adicional. Otras preguntas buscan conocer más de ti como estudiante, de tu colegio y el apoyo que recibes. De esta manera se espera que todos y todas puedan alcanzar mayor éxito con sus estudios.</p><br><br><p>Algunas de las preguntas que te planteamos serán más complicadas que otras. Pregunta si tienes dudas. Se trata de contarnos qué sientes y piensas con sinceridad.</p></div><br><br><p>Muchas gracias por tu colaboración!</p>', '<p class="text-justify">A continuación, tienes una serie de preguntas, te pedimos que contestes con sinceridad, no hay respuestas buenas ni malas. Para cada pregunta marca la respuesta que estimes pertinente. En unas preguntas te pedimos que contestes pensando en la frecuencia con la que sueles sentir, pensar o hacer algunas cosas. En otras preguntas, se trata de que nos cuentes  sobre ti como estudiante, el colegio y el apoyo que recibes.</p>', 1),
	(2, '<div><h2>¡Hola!</h2><p class="text-justify">La encuesta que estás respondiendo es de gran utilidad para medir el compromiso que tienes con tus estudios y el liceo, y así poder saber qué estudiante o clases requieren un apoyo adicional. Otras preguntas buscan conocer más de ti como alumno, de tu liceo y el apoyo que recibes. De esta manera se espera que todos y todas puedan alcanzar mayor éxito con sus estudios.</p><br><br><p>Algunas de las preguntas que te planteamos serán más complicadas que otras. Pregunta si tienes dudas. Se trata de contarnos qué sientes y piensas con sinceridad.</p></div><br><br><p>¡Muchas gracias por tu colaboración!</p>', '<p class="text-justify">A continuación, tienes una serie de preguntas, te pedimos que contestes con sinceridad, no hay respuestas buenas ni malas. Para cada pregunta marca la respuesta que estimes pertinente. En unas preguntas te pedimos que contestes pensando en la frecuencia con la que sueles sentir, pensar o hacer algunas cosas. En otras preguntas, se trata de que nos cuentes  sobre ti como estudiante, el liceo y el apoyo que recibes.</p>', 2),
	(3, '<div><h2>¡Hola!</h2><p class="text-justify">La encuesta que estás respondiendo es de gran utilidad para medir el compromiso que tienes con tus estudios y el colegio, y así poder saber qué estudiantes o aulas requieren un apoyo adicional. Otras preguntas buscan conocer más de ti como estudiante, de tu colegio y el apoyo que recibes. De esta manera se espera que todos y todas puedan alcanzar mayor éxito con sus estudios.</p><br><br><p>Algunas de las preguntas que te planteamos serán más complicadas que otras. Pregunta si tienes dudas. Se trata de contarnos qué sientes y piensas con sinceridad.</p></div><br><br><p>¡Muchas gracias por tu colaboración!</p>', '<p class="text-justify">A continuación, tienes una serie de preguntas, te pedimos que contestes con sinceridad, no hay respuestas buenas ni malas. Para cada pregunta marca la respuesta que estimes pertinente. En unas preguntas te pedimos que contestes pensando en la frecuencia con la que sueles sentir, pensar o hacer algunas cosas. En otras preguntas, se trata de que nos cuentes  sobre ti como estudiante, el colegio y el apoyo que recibes.</p>', 3),
	(4, '<div><h2>¡Hola!</h2><p class="text-justify">La encuesta que estás respondiendo es de gran utilidad para medir el compromiso que tienes con tus estudios y el colegio, y así poder saber qué estudiantes o cursos requieren un apoyo adicional. Otras preguntas buscan conocer más de ti como estudiante, de tu colegio y el apoyo que recibes. De esta manera se espera que todos y todas puedan alcanzar mayor éxito con sus estudios.</p><br><br><p>Algunas de las preguntas que te planteamos serán más complicadas que otras. Pregunta si tienes dudas. Se trata de contarnos qué sientes y piensas con sinceridad.</p></div><br><br><p>¡Muchas gracias por tu colaboración!</p>', '<p class="text-justify">A continuación, tienes una serie de preguntas, te pedimos que contestes con sinceridad, no hay respuestas buenas ni malas. Para cada pregunta marca la respuesta que estimes pertinente. En unas preguntas te pedimos que contestes pensando en la frecuencia con la que sueles sentir, pensar o hacer algunas cosas. En otras preguntas, se trata de que nos cuentes  sobre ti como estudiante, el colegio y el apoyo que recibes.</p>', 4),
